#include<bits/stdc++.h>using namespace std;typedef long long ll;void f(ll n,vector<ll>&a){    for(ll i=0;i<n;i++)cin>>a[i];} void solve(){    ll n,k;    cin>>n>>k;    queue<ll>q;    unordered_map<ll,ll>mp;    for (ll i = 0; i < n; i++)    {        ll a;        cin>>a;        if(mp.count(a)==0){            q.push(a);            mp[a]++;        }        if(q.size()>k){            mp[q.front()]--;            if(mp[q.front()]==0)mp.erase(q.front());            q.pop();        }    }    vector<int>ans;    while (!q.empty())    {        ans.push_back(q.front());        q.pop();    }    cout<<ans.size()<<'\n';    for (ll i = ans.size()-1; i>=0; i--)    cout<<ans[i]<<" ";    cout<<'\n';    } int main(){solve();    return 0;}